import React from 'react';

const TextPost = ({title, body, datePosted}) => {
    return (
        <div style={{outline: '1px solid black', width: '33vh', marginBottom: 10, marginTop: 10}}>
            <h1>{title}</h1>
            <p>{body}</p>
        </div>
    )
}

export default TextPost;
